-- ----------------------------
-- Records of notas
-- ----------------------------
INSERT INTO `notas` VALUES (8, 2, 'Presencia de Azufre en Salinas', 'El Colectivo Ecologista de Avilés denunció ayer picos en los niveles de azufre en el entorno de Salinas, que provocaron las denuncias de vecinos por el mal olor. «No se superaron los umbrales de alerta en ninguna estación, pero si coinciden estos picos con el fuerte olor denunciado por los vecinos», explicaron ayer los ecologistas. Estos pequeños picos en los niveles de azufre se registraron en las estaciones de Las Arobias y la del Faro en Gozón.', 'data:image/jpeg;base64,', '2023-05-05 20:57:03', '2023-05-06 02:57:03', '2023-05-06 02:57:03');
INSERT INTO `notas` VALUES (11, 2, 'Encontrados a salvo los diez migrantes colombianos', 'La Fiscalía estatal de Sonora ha informado de la aparición de los diez migrantes procedentes de Colombia que desaparecieron el martes, en torno a las 11 de la mañana, cuando cruzaban la ciudad fronteriza de San Luis Río Colorado rumbo a Estados Unidos, adonde tenían previsto cruzar. Los siete hombres y tres mujeres han sido localizados este viernes por la noche', 'data:image/jpeg;base64,', '2023-05-06 10:00:13', '2023-05-06 16:00:13', '2023-05-06 16:00:13');
INSERT INTO `notas` VALUES (12, 2, 'Un incendio consume una parte de la refinería de Deer Park, en Texas', 'Un incendio ha consumido este viernes una instalación petroquímica de Deer Park, localizada en Texas, Estados Unidos. Petróleos Mexicanos (Pemex) —que el año pasado compró la refinería de petróleo en el territorio— ha defendido que no se han producido daños en sus instalaciones, y han afirmado que el fuego ha tenido lugar en una planta cercana, perteneciente a la empresa de combustibles Shell.', 'data:image/jpeg;base64,', '2023-05-06 10:02:42', '2023-05-06 16:02:42', '2023-05-06 16:02:42');

